The Sword with No Name (2009)


Zuid-Korea
Actie
123 minuten

geregisseerd door Yong-gyun Kim
met Jae-woong Choi, Seung-woo Cho en In-gu Heo

Moo Myeong is een premiejager die zijn leven volledig te dienste stelt van zijn keizerin Myeonseong. Als gemalin van keizer Gojong wordt zij in de Koreaanse geschiedenis gezien als een nationale heldin, die actief betrokken was bij de politiek en diplomatie om Korea te moderniseren en het Japanse imperialisme te doorstaan. De premiejager Moo Myeong leeft van dag tot dag, door het oppakken van vluchtelingen, maar zijn leven veranderd voorgoed als hij verliefd wordt op de bloedmooie Ja Yeong. Zij is echter voorzien als volgende koningin van Joseon en daarom trekt zij een paar jaar later in in het paleis, waar de dolverliefde Moo Myeong haar volgt. Hij voegt zich bij de koninklijke wacht om haar te beschermen. Hij blijft loyaal aan haar zijde als zij de hofpolitiek stuurt en later op de troon belandt als volgende 'Keizerin van de Joseondynastie '



